import React from 'react';
import Header from './Header';
import Sidebar from './Sidebar';
import Feed from './Feed';
import './App.css';
import Widget from './Widget';

function App() {
  return (
    // BEM naming convention
    <div className="app">
      <Header />

      <div className="app__body">
          <Sidebar />
          <Feed />  
          <Widget />
      </div>
    </div>
  );
}

export default App;
